import React, { FunctionComponent, useState } from 'react';
import Pokemon from './models/pokemon';
import POKEMONS from './models/mock-pokemon';

const App: FunctionComponent = () => {
    const [pokemons] = useState<Pokemon[]>(POKEMONS);

    return (
        <div>
            <h1> Pokedex </h1>
            <p>Le nombre de pokemon est {pokemons.length} pokemens</p>
                <ul>
                    {pokemons.map((pokemens, index) => (
                    <div>
                        <li key={index}> {pokemens.name}</li>
                        <li key={index}> {pokemens.hp}</li>
                        <li key={index}> {pokemens.cp}</li>
                        <li key={index}> {pokemens.types}</li>
                    </div>
                    ))}
                </ul>
        </div>
    )
}

export default App;
